`,n.jsx(e.p,{children:"JIT는 Just In Time의 약자로, 프로그램이 실행되는 시점에 컴파일을 하는 방식입니다."}),`
`,n.jsx(e.p,{children:"전통적인 입장에서 컴퓨터 프로그램을 만드는 방법은 두 가지가 있는데, 인터프리트 방식과 정적 컴파일 방식으로 나눌 수 있다. 이 중 인터프리트 방식은 실행 중 프로그래밍 언어를 읽어가면서 해당 기능에 대응하는 기계어 코드를 실행하며, 반면 정적 컴파일은 실행하기 전에 프로그램 코드를 기계어로 번역한다."}),`
`,n.jsx(e.p,{children:"JIT 컴파일러는 두 가지의 방식을 혼합한 방식으로 생각할 수 있는데, 실행 시점에서 인터프리트 방식으로 기계어 코드를 생성하면서 그 코드를 캐싱하여, 같은 함수가 여러 번 불릴 때 매번 기계어 코드를 생성하는 것을 방지한다."}),`
`,n.jsx(e.p,{children:"최근의 자바 가상 머신과 .NET, V8(node.js)에서는 JIT 컴파일을 지원한다. 즉, 자바 컴파일러가 자바 프로그램 코드를 바이트코드로 변환한 다음, 실제 바이트코드를 실행하는 시점에서 자바 가상 머신이 바이트코드를 JIT 컴파일을 통해 기계어로 변환한다."}),`
`,n.jsxs(e.blockquote,{children:[`
`,n.jsx(e.p,{children:"바이트코드는 기계어는 아니지만 가상 머신에 의해 기계어로 손쉽게 변환할 수 있는 코드이다."}),`
`]}),`
`,n.jsx(e.h2,{children:"AOT Compiler"}),`
`,n.jsx(e.p,{children:"AOT 컴파일(ahead-of-time compile)은 목표 시스템의 기계어와 무관하게 중간 언어 형태로 배포된 후 목표 시스템에서 인터프리터나 JIT 컴파일 등 기계어 번역을 통해 실행되는 중간 언어를 미리 목표 시스템에 맞는 기계어로 번역하는 방식을 지칭한다. 이런 중간 언어로는 자바 바이트코드, 공통 중간 언어(Common Intermediate Language), IBM System/38 혹은 IBM System i의 기술 독립적 머신 인터페이스(Technology Independent Machine Interface)가 있으며 학계에서도 마이클 프란즈(Michael Franz)가 제안해 오베론 시스템의 일부 구현에서 사용된 슬림 바이너리(Slim Binaries)와 같은 제안이 있었다."}),`
`,n.jsx(e.p,{children:"일반적으로 중간 언어를 사용하는 시스템은 실행 시간에 JIT 컴파일과 같은 기법을 통해 실행 시에만 얻을 수 있는 프로그램 분석 정보를 사용하여 높은 성능을 달성할 수 있다. 특히 객체 지향 언어나 스크립트 언어 같이 동적인 언어인 경우 효과적이다. 하지만 실행 시 프로그램 분석과 컴파일을 함께 수행하는데 추가 메모리 및 CPU 사이클이 필요한 단점이 있다. 따라서 AOT 컴파일은 이에 대한 보완책으로 사용되고 있다."})]})}function qCe(t={}){const{wrapper:e}=t.components||{};return e?n.jsx(e,{...t,children:n.jsx(PI,{...t})}):PI(t)}const XCe=()=>n.jsx(qCe,{components:{h1:t=>n.jsx("h1",{className:"text-4xl font-bold text-foreground mb-4",...t}),h2:t=>n.jsx("h2",{className:"text-3xl font-semibold text-foreground mt-8 mb-4",...t}),h3:t=>n.jsx("h3",{className:"text-2xl font-medium text-foreground mt-6 mb-3",...t}),p:t=>n.jsx("p",{className:"text-foreground leading-relaxed mb-4",...t}),ul:t=>n.jsx("ul",{className:"list-disc list-inside mb-4",...t}),ol:t=>n.jsx("ol",{className:"list-decimal list-inside mb-4",...t}),li:t=>n.jsx("li",{className:"mb-2",...t}),a:t=>Se(t.href).with(Te.string.startsWith("/"),e=>n.jsx(_e,{...t,href:""+e.replace(".mdx","").replace(/\/index$/,""),to:"/",className:"text-blue-400"})).otherwise(()=>n.jsx("a",{className:"text-blue-400",...t})),code:t=>n.jsx("code",{className:"bg-gray-100 text-red-600 px-1 py-0.5 rounded",...t}),blockquote:t=>n.jsx("blockquote",{className:"border-l-4 border-gray-300 pl-4 italic text-gray-600",...t}),img:t=>n.jsx("img",{className:"rounded-lg shadow-md my-4",...t}),pre:t=>{const e=t.children,{className:r,children:i}=e.props;return n.jsx(Me,{languege:(r==null?void 0:r.split("-").slice(1).join(""))??"javascript",code:i})}}}),YCe=ve("/_layout/til/cs/aot_and_jit_compiler")({component:XCe});function LI(t){const e={a:"a",code:"code",h1:"h1",h2:"h2",h3:"h3",hr:"hr",li:"li",ol:"ol",p:"p",pre:"pre",strong:"strong",ul:"ul",...t.components};return n.jsxs(n.Fragment,{children:[n.jsx(e.hr,{}),`
