`,n.jsx(e.p,{children:"이러한 로직이 프론트엔드에 있는 것 괜찮으신가요? 또, 여러 프론트엔드에서 다 이런 로직을 사용하고 있습니다. BFF에서 한 번의 치환으로 모두 isShowable이라는 변수만 보게하면 좋을 것 같습니다."}),`
