`,n.jsx(e.p,{children:"프론트엔드에서 사용할 경우에는 단순히 field를 추가하는 것 처럼 사용을 하면 되고, BFF에서는 field를 사용한 경우에는 field resolver가 실행되고, 그렇지 않은 경우네느 실행이 되지 않아서 서버 자원을 동적으로 사용할 수 있습니다."}),`
