    let fast: ListNode | null = head;

    while (fast && fast.next) {
        slow = slow!.next;           // 한 칸씩 이동
        fast = fast.next.next;       // 두 칸씩 이동

        if (slow === fast) {
            return true; // slow와 fast가 만나면 사이클이 있음
        }
    }

    return false; // fast가 null에 도달하면 사이클이 없음
